import { render } from "@testing-library/react";
import React from "react";

class ContactsList extends React.Component {
    render() {
        return (
            <div>
                {
                    this.props.persons.map(function (person) {
                        return(
                            <div>
                                <p>{person.name}</p>
                                <p>{person.phone}</p>
                                <img src={person.img} />
                            </div>
                        )
                    })
                }
            </div>
        )
    }
}

export default ContactsList;
